    false,nt"url": null,nt"notes": "The Climate Prediction Center (CPC) issues
    8 to 14 day probabilistic precipitation outlooks for the United States. The 8-14
    day Outlook gives the confidence that a forecaster has, given as a probability,
    that the observed precipitation, totaled over upcoming days 8, 9, 10, 11, 12, 13,
    and 14 will be in the range of one of three possible categories: below median (B),
    near median (N), or above median (A). For any calendar 7-day period, these categories
    can be defined by fitting a Gamma distribution to the 30 years of the climatology
    period, 1981-2010, and dividing this distribution into equally likely partitions
    (below median, near median, and above median). Note that the base period for the
    thirty year climatology (currently beginning in 1981 and ending in 2010) is updated
    once per decade. Because each of these categories occurs 1/3 of the time for any
    particular calendar 7-day period, the probability of any category being selected
    at random from the 1981-2010 set of 30 observations is one in three (1/3), or 33.33%.
    This is also called the climatological probability. The sum of the climatological
    probabilities of the three categories is 100%.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
